import React, { useState, useEffect } from "react";

function Home() {
  {
    document.title = "Phone Phlinger | Home";
    document.getElementsByTagName("META")[3].content =
      "This is the meta for the home page!";
  }
  const [something, setSomething] = useState("abc"); // just a quick reminder for state
  const sendRequest = () => {
    return fetch("/test", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        secured: "true",
      },
      something: JSON.stringify(something),
    })
      .then((response) => response.json())
      .then(setSomething(response))
      .catch((error) => console.log(error));
  };

  return (
    <div>
      <h1>This is the Home Page!</h1>
      <button onClick={sendRequest}>click me to do something!</button>
      <h2>{something}</h2>
    </div>
  );
}

export default Home;
